ge = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1235521","type":"CustomJS"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"1235356","type":"WheelZoomTool"},{"attributes":{},"id":"1235361","type":"SaveTool"},{"attributes":{"below":[{"id":"1235150"}],"center":[{"id":"1235153"},{"id":"1235157"},{"id":"1235211"}],"height":110,"left":[{"id":"1235154"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"1235179"},{"id":"1235185"},{"id":"1235195"},{"id":"1235217"},{"id":"1235240"},{"id":"1235265"}],"sizing_mode":"stretch_width","title":{"id":"1235197"},"toolbar":{"id":"1235166"},"toolbar_location":null,"width":null,"x_range":{"id":"1235101"},"x_scale":{"id":"1235146"},"y_range":{"id":"1235144"},"y_scale":{"id":"1235148"}},"id":"1235142","subt
